    false,nt"url": null,nt"notes": "This application provides a way to geospatially
    locate a selected set of non-georeferenced scanned historic air photos for Idaho
    contained in the Idaho aerial views database. It allows users to determine the flight
    year, the University of Idaho CD-ROM call number, and the TIFF image name for every
    fifth image along a given project flight line. The selected projects contained include:
    1927 Vertical air photos of the western portion of the Nez Perce National Forest
    1928 Vertical air photos of the western portion of the Nez Perce National Forest
    1929 Clearwater resource project: vertical air photos of the St. Joe & Clearwater
    National Forest, Idaho. 1932 Project N and C: vertical air photos of the Nez Perce
    and Clearwater National Forest Van Buren Creek, Riggins Hot Springs, Tollgate Creek,
    Cabin Creek, and Woodrat Mountain. Vertical air photos of the Selway National Forest,
    1932 Fish Creek, Coolwater Ridge, Selway River, Fenn, and Lower Lochsa River, Idaho.
    1933 Project S vertical air photos of Selway National Forest & northern Nez Perce
    National Forest, Idaho. Project JO air photos of eastern Latah and western Clearwater
    Counties, Idaho. Project J air photos, 1933 Latah County, Idaho. Project J and JO:
    air photos of the St. Joe National Forest. 1935 Project N, vertical air photos of
    the Eastern Nez Perce National Forest Meadow Creek, Bargamin Creek, Running Creek
    and the Selway River. 1936 Project EZ, vertical airphotos of the Eastern portion
    of the Cearwater National Forests. Project EV: vertical air photos of the Central
    and Eastern portions of the Nez Perce National Forest Elk City, Meadow Creek, Green
    Mountain, and Black Hawk Mountain. Project N, 1936 vertical air photos of the Nez
    Perce National Forest: Meadow Creek and the American River. 1937 Project CF 1937
    vertical air photos of the Coeur d'Alene National Forest and vicinity (Kootenai
    County and Shoshone County. Project EZ: air photos of the Powell Ranger District
    of the Clearwater National Forest, Idaho. Project FA: air photos of the Powell Ranger
    District of the Clearwater National Forest, Idaho. 1939 Project FA and GSK: air
    photos of the Nez Perce National Forest Meadow Creek, Selway River and the western
    portion of the forest. 1948 Project C, 1948 air photos of the Clearwater National
    Forest, Idaho (Musselshell, Austin Ridge, Hemlock Butte, Lolo Creek, and Beaver
    Dam Saddle).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
